export class Init {
    load() {
      if(localStorage.getItem('currentUser') === null || localStorage.getItem('currentUser') == undefined) {
        console.log('No current User found... Creating...');
        let currentUser = 
          {
            id: 1686497103732,
            FirstName: "John",
            LastName: "Doe",
            Email: "john.doe@example.com"
          }
        ;
  
        localStorage.setItem('currentUser', JSON.stringify(currentUser));
        return 
      } else {
        console.log('Current user already created...');
      }
    }
}
